import styled from "styled-components";

export const ExamplePreview = styled.img`
  max-width: 100%;
  border-radius: 0.5rem;
  box-shadow: 0 1rem 4rem 0 rgba(21, 20, 50, 0.1);
  margin: 1rem auto 3rem;
`;
